import React from 'react'
import { Route, Router, Routes } from 'react-router-dom'
import Exercises from './components/Exercises'

const API_URL = 'http://127.0.0.1:8000/api/'

const App = () => {
  return (
    <Router>
      <Routes>
        <Route 
          path='/' 
          element={
            <Exercises API_URL={API_URL} />
          }
        />
      </Routes>
    </Router>
  )
}

export default App
